import './App.css';

import {ReactComponent as Brain} from './assets/brain.svg';

import ScrollingText from './components/ScrollingText/ScrollingText';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Brain className="logo" />

        <h2 className="scrollTest1">Scrolling Test 1 </h2>

        <h1 className="scrollTest2">Scrolling Test 2 </h1>

        <p className="scrollTest3">Scrolling Test 3 </p>

        <h3 className="scrollTest4">Scrolling Test 4 </h3>

        <ScrollingText anDur={1} />

      </header>
    </div>
  );
}

export default App;
